import React, { Fragment } from "react";
import {
  Container,
  Card,
  Form,
  FormLabel,
  Row,
  Col,
  Button,
  FormCheck,
  FormGroup,
  FormSelect,
  FormControl,
} from "react-bootstrap";
import TablaCard from "../componentes/layout/TablaCard";
import Contacto from "../componentes/principal/Contacto";
import Eventos from "../componentes/principal/Eventos";


const Principal = () => {
  let columnas=(
    <tr>
      <th>Pos</th>
      <th>Nombre</th>
      <th>Num</th>
      <th>Jinete</th>
      <th>Stud</th>
      <th>Tiempo</th>
    </tr>
  );
  return (
    <Fragment>
      <Eventos></Eventos>
      <TablaCard columnas={columnas}></TablaCard>
      <Contacto></Contacto>
    </Fragment>
  );
};

export default Principal;
